import { Component } from 'react';
import './Gallery.css'
import PropTypes from "prop-types";
import Search from '../Search/Search';

class Gallery extends Component {
    constructor(props) {
        super(props);
        this.handlePositionChange = this.handlePositionChange.bind(this);
        this.hideSearch = this.hideSearch.bind(this);
    }
    static propTypes = {
        onPositionChange: PropTypes.func,
    };

    static defaultProps = {
        onPositionChange: () => { }
    }

    handlePositionChange(event) {
        const onPositionChange = this.props.onPositionChange;
        onPositionChange(event);
    }

    hideSearch() {

    }

    render() {
        this.hideSearch();
        return (
            <div class="Gallery" id = "GalleryID">
                <button class = "Position" id = "All" onClick={this.handlePositionChange}>All</button>
                <button class = "Position" id = "PG" onClick={this.handlePositionChange}>PG</button>
                <button class = "Position" id = "SG" onClick={this.handlePositionChange}>SG</button>
                <button class = "Position" id = "G" onClick={this.handlePositionChange}>G</button>
                <button class = "Position" id = "SF" onClick={this.handlePositionChange}>SF</button>
                <button class = "Position" id = "PF" onClick={this.handlePositionChange}>PF</button>
                <button class = "Position" id = "F" onClick={this.handlePositionChange}>F</button>
                <button class = "Position" id = "C" onClick={this.handlePositionChange}>C</button>
            </div>
        );
    }
}

export default Gallery;
